Available in White or Black.
Releasing on our website Sep 6th. 
“Y2K.”
In this Drop we are including new Shirts, Hats, and Long sleeves.
At the peak of the new millennium, there was a widespread rumor that all the technology the world had become reliant on would suddenly stop. “The Millennium Bug,” was its nickname.  People believed that computers, military tech, transportation systems, medical equipment, and all other forms of tech would collapse because of a calendar and formatting data issue. This idea began to spread so virally across mainstream society, that people believed that when the New Year’s Clock showed “2000,” the world would come to an end. Now this only heightened the excitement and shock of what would become the start of a new period. People began hosting “end of the world,” NYE themed parties. An interesting turn, in the fear of the world ending, people began to celebrate with their closest friends and families. Today, we see the term “Y2K,” used to describe an aesthetic that defined the early 2000s. With our new design, we want to highlight this idea, that this tragic event was turned into something that could describe the “beauty,” of the time that it occurred.
COP your shirt ONLINE or at our POP-UP at @thevaulti.us on Sunday. 
